import React from "react";
import "./Header.css";

const Header = () => (
  <header className = "jumbotron">
    <h1>Star Trek Click Game</h1>
    <h3>Try to avoid clicking the same image more than once after they shuffle</h3>
  </header>
);

export default Header;
